import axios from "axios";
import React, { useEffect, useState } from "react";
import { Table } from "reactstrap";
import "../SalesSheetcomponent/SalesSheetCard.css";
import FilterByTicketNumber from "./FilterByTicketNumber";
import JuniperREF from "./JuniperREF";
function SalesSheetCard() {
  const [data, setdata] = useState(null);
  const [err, seterr] = useState(null);

  useEffect(() => {
    axios
      .get("https://puce-enthusiastic-swordfish.cyclic.app/salesB2C")
      .then((Nwedata) => setdata(Nwedata.data))
      .catch((err) => seterr(err));
  }, []);
  const formatDate = (dateString) => {
    const options = { year: "numeric", month: "long", day: "numeric" };
    const date = new Date(dateString);
    return date.toLocaleDateString("en-US", options);
  };

  return (
    <div>
      <Table hover>
        <thead>
          <tr className="table-raw">
            <th>#</th>
            <th>TicketNumber</th>
            <th>AgentName</th>
            <th>ProductType</th>
            <th>GuestName</th>
            <th>Supplier</th>
            <th>SupplierCategory</th>
            <th>JuniperREF</th>
            <th>SupplierReference</th>
            <th>CheckInDate</th>
            <th>CheckOutDate</th>
            <th>Vouchernumber</th>
            <th>SalesRate</th>
            <th>NetRate</th>
            <th>Currency</th>
            <th>ExchangeRate</th>
            <th>NetRateINKWD</th>
            <th>Profit</th>
            <th>Remarks</th>
          </tr>
        </thead>
        <tbody>
          {data.msg.map((v, i) => (
            <tr key={i}>
              <th scope="row" className="HeadNum">
                {i + 1}
              </th>
              <td>{v.TicketNumber}</td>

              <td>{v.AgentName}</td>
              <td>{v.ProductType}</td>
              <td>{v.GuestName}</td>
              <td>{v.Supplier}</td>
              <td>{v.SupplierCategory}</td>
              <td>{v.JuniperREF}</td>
              <td>{v.SupplierReference}</td>
              <td>{formatDate(v.CheckInDate)}</td>
              <td>{formatDate(v.CheckOutDate)}</td>
              <td>{v.Vouchernumber}</td>
              <td>{v.SalesRate}</td>
              <td>{v.NetRate}</td>
              <td>{v.Currency}</td>
              <td>{v.ExchangeRate}</td>
              <td>{v.NetRateINKWD}</td>
              <td>{v.Profit}</td>
              <td>{v.Remarks}</td>
            </tr>
          ))}
        </tbody>
      </Table>
      {data === null && <h3>no data available</h3>}
      {/* <FilterByTicketNumber data={data} />
      <JuniperREF data={data} /> */}
    </div>
  );
}

export default SalesSheetCard;
